  const sanitize = (text) => {
    if (!text) return text;

    // Remove tudo que está entre colchetes, incluindo colchetes
    text = text.replace(/\[.*?\]/g, '');
    // Substitui caracteres Unicode específicos
    text = text.replace(/\u00E9/g, 'e');  // Exemplo: substitui 'é' por 'e'
    text = text.replace(/\u00E1/g, 'a');  // Exemplo: substitui 'á' por 'a'
    text = text.replace(/\u00ED/g, 'i');  // Exemplo: substitui 'í' por 'i'
    text = text.replace(/\u00F3/g, 'o');  // Exemplo: substitui 'ó' por 'o'
    text = text.replace(/\u00FA/g, 'u');  // Exemplo: substitui 'ú' por 'u'
    // Remove caracteres não ASCII
    text = text.replace(/[^ -~]/g, '');

    // Remove caracteres especiais e pontuações indesejadas
    text = text.replace(/[^\w\s]/gi, '');

    // Substituir múltiplos espaços por um único espaço
    text = text.replace(/\s+/g, ' ');

    return text.trim();
  };

  // Cria uma cópia do item sem o campo annotations
  const cleanItem = { ...item };

  // Se houver content, processa cada elemento mantendo apenas os campos necessários
  if (cleanItem.content) {
    cleanItem.content = cleanItem.content.map(content => {
      if (content.text) {
        // Para elementos text, mantém apenas type, text e value
        return {
          type: content.type,
          text: {
            value: content.text.value
          }
        };
      }
      return content;
    });
  }

  return cleanItem;
});

